import React from "react";

export default function PredictionResult({ result }) {
  const getRiskColor = (tier) => {
    if (tier === "HIGH") return "danger";
    if (tier === "MEDIUM") return "warning";
    return "success";
  };

  return (
    <div className="card mt-4 p-3 shadow-sm">
      <h4 className="text-center mb-3">ðŸ“Š Prediction Results</h4>
      <p><strong>Dropout Probability:</strong> {result.dropout_probability}</p>
      <p><strong>Deservingness Score:</strong> {result.deservingness_score}</p>
      <p>
        <strong>Risk Tier:</strong>{" "}
        <span className={`badge bg-${getRiskColor(result.risk_tier)}`}>
          {result.risk_tier}
        </span>
      </p>
    </div>
  );
}
